import { Link, Outlet } from "react-router-dom";
import styled from "styled-components";

const Top = styled.div`
    background-color: #e37676;
    display: flex;
    width: 500px;
    justify-content: space-between;
`

const Logo = styled.div`
`
const MainLogo = styled.img`
    width: 50px;
`
const Div = styled.div`
    display: flex;
    justify-content: space-between;
    width: 150px;
`
const Profile = styled.div`
`
const Like = styled.div`
`
const Chat = styled.div`
`
const a = {
    color: "white",
}

export default function TopLayout(){
    return(
        <>
            <Top>
                <Logo><Link to="/"><MainLogo src={process.env.PUBLIC_URL + '/image/untity.png'}/></Link></Logo>
                <Div>
                    <Profile><Link style={a} to="/">프로필</Link></Profile>
                    <Like><Link style={a} to="/">좋아요</Link></Like>
                    <Chat><Link style={a} to="/">채팅</Link></Chat>
                </Div>
            </Top>
            <Outlet/>
        </>
    );
}
